function doFilter(){
	
	var host = [];
	var sparkCallNodes = [];
	var webexNodes = [];
	$.each(filterTree.getUnSelectedNodes(), function(i, node) {
		var value = $(node).attr('value');
		var valsegs = value.split(":");
		if(valsegs.length > 1) {
			if(valsegs[0] == 'sparkCallNodes') {
				sparkCallNodes.push(valsegs[1]);
			} else if(valsegs[0] == 'webexNodes') {
				webexNodes.push(valsegs[1]);
			} else if(valsegs[0] == 'host') {
				host.push(valsegs[1]);
			}else if(valsegs[0] == 'sparkNodes') {
                host.push(valsegs[1]);
            }
		}
	});
	console.info({matsSessionId:'', ipHosts:host.join(','), sparkCallNodes: sparkCallNodes.join(','), webexNodes: webexNodes.join(',')});
	
	SVGFixedObject.getInstance().destroy();
	$('#callflow').hide();
	$('#progress').show();
	
	$.ajax({
		type: "POST",
		url: '/rest/cmr/session/callflow/doCallFlowFilter',
		data: {ipHosts:host.join(','), actionType:"8", id:"265354731", sipCallId:"'76lr6Tc32aqwRJ32VnXNhg..','0013dd3730e33b618467805fae91b96e@10.120.172.27','0ca6ebbe7b29c1a1a4e30288834123fd@127.0.0.1'",timeZone:"(GMT+05:30) Indian Standard Time--IST",baseUrl:"http://matsbts.webex.com:80"},
		//data: {matsSessionId:'', ipHosts:host.join(','), sparkCallNodes: sparkCallNodes.join(','), webexNodes: webexNodes.join(',')},
		dataType: 'json',
		success: function(resultData, textStatus){
			$('#progress').hide();
			$('#callflow').html(resultData);

	});
}
